import { Component, OnInit } from '@angular/core';
import { VisitorManagementService } from 'src/app/services/visitor-management.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent implements OnInit {
  qRCodeData: string = 'data:image/png;base64,'
  // qrCode : any

  ngOnInit(): void {
      // this.generateAddVisitorFormQrCode();
  }

  constructor(private visitorService :VisitorManagementService) {}

  generateAddVisitorFormQrCode(){

    this.visitorService.generateAddVisitorFormQRCode().subscribe({
      next:(response) =>{
        if(response.token === 1 && response.statusCode === '200'){
          this.qRCodeData = response.data;
          // this.qrCode = this.qRCodeData.data
          console.log(this.qRCodeData)
        }
      },
      error:(error)=>{
        console.log(error);
      }
    })
  }

}
